// import dependencies
import { Link } from "../../utils/links";

// import components
// import { Navlink2 } from "../../utils/links";

// import components
// utils
import PrivateRoute from "../../utils/PrivateRoute.js";

const Dashboard = () => {
  const content = (
    <>
      <Link text="CREATE-BLOG" to="/newblog" />
      <Link text="CREATE-WORK" to="/newwork" />
      <Link text="UPDATE-PROFILE" to="/updateprofile" />
    </>
  );

  return <PrivateRoute content={content} />;
};

export default Dashboard;
